    false,nt"url": null,nt"notes": "Bullheads (Ictalurus sp.), carp (Cyprinus
    carpio), a quillback (Carpiodes cyprinus), a bigmouth buffalo (Ictiobus cyprinellus),
    and a turtle were collected from Elk, Honeyhouse, Turkey, and Yellow Creeks located
    on or near the border of Swan Lake National Wildlife Refuge near Sumner, Chariton
    County, Missouri. Whole fish samples and turtle fat and liver were analyzed for
    various metal and organic contaminants to determine if concentrations were elevated
    in the biota located on the refuge. Results were compared to the literature and
    potential contaminant problems were recognized. Concentrations of copper, chromium,
    manganese, zinc, chlordane, and dieldrin either exceeded or were the same as concentrations
    in the literature where adverse effects to biota were reported. However, a limited
    number of samples were collected at Swan Lake National Wildlife Refuge and different
    types of tissues were analyzed which may demonstrate the reason for higher concentrations.
    If concern is shown for populations of fish and wildlife resources using Swan Lake
    National Wildlife Refuge because of decreasing numbers or health, further investigations
    into these compounds should begin.",nt"license_title": "License Not Specified",nt"extras":
